import { Link } from "react-router-dom";
const Nav=()=>{
    return(
        <nav >
            <ul>
                <li>
                    <Link to="/app">Home</Link>
                </li>
                <li>
                    <Link to="/app/leaderboard">Leaderboard</Link>
                </li>
                <li>
                    <Link to="/app/new">New</Link>
                </li>
            </ul>
        </nav>
    );

};
export default Nav;
